window.bookSummaryJSON = "<p>Each member of Omega Force carries his own baggage. Most of them are running from their pasts or simply trying to forget them. One member of the small mercenary crew is not who he claims to be, however. When his former life collides with his current one, the team is drawn into a conflict that could have profound consequences for the future of an entire species. Captain Jason Burke struggles to find answers as the tight cohesion of his crew seems to dissolve. No matter the outcome of the mission, can Jason keep Omega Force together once the dust settles? </p>"; 
